		"text": "@davidpapineau @wimbledonsm @danieldennett Another reason is that the concept of the phenomenal is hopelessly bound up with a bunch of deeply misleading intuitions and assumptions (esp  about the reliability of introspection). Let's just cut the tangled kite string, as @danieldennett says!"
